def twoSum(numbers, target):
    firstPointer, secondPointer = 0, 1

    for i in range(len(numbers)):
        for j in range(len(numbers)):
            if ((numbers[firstPointer] + numbers[secondPointer] != target and numbers[firstPointer] == numbers[secondPointer]) or numbers[firstPointer] + numbers[secondPointer] > target or secondPointer == len(numbers)):
                firstPointer += 1
                secondPointer = firstPointer + 1
                break
            elif (numbers[firstPointer] + numbers[secondPointer] == target):
                return [firstPointer+1, secondPointer+1]
            else:
                secondPointer += 1
                if (secondPointer == len(numbers)):
                    firstPointer += 1
                    secondPointer = firstPointer + 1
                    break

    
